/** @format */

import React from "react";
import Navbar from "./Components/Navbar";
import Footer from "./Components/Footer";
const Error = () => {
  return (
    <>
      <Navbar />
      <h1> 404 page not found</h1>
      <Footer />
    </>
  );
};
export default Error;
